import React from "react"
import { Text,View,StyleSheet } from "react-native"

const Home = ()=>{
    return(
        <View style={styles.container}>
            <Text>Home Screen!</Text>
        </View>
    )
}

const styles =StyleSheet.create({
    container:{
        flex:1,
        alignContent:"center",
        backgroundColor:"darkstealblue",
    }
})
